import React from 'react';

import Header from '../../components/01_sections/header/HomeHeader';
import RightFixed from '../../components/01_sections/rightFixed/RightFixed';

function FoodTruck() {
  return (
    <div height="500px">
      <Header />
      <iframe
        src="https://noahsjung.com/works/food-truck-finder"
        // style="border: 0"
        position="fixed"
        top="0"
        left="0"
        right="0"
        bottom="0"
        width="100%"
        height="1000px"
        title="food-truck-finder"
      ></iframe>
    </div>
  );
}

export default FoodTruck;
